  const [turnData, setTurnData] = useState(any)
  const callback = (data) => {
    setTurnData(data)
  }

  return (
    <div className="App">
        <ChessBoard callback={callback(data)}/>
        <CommentSection/>
    </div>
  )
}

export default App;
